node.text:
4am story time with my Son son, we’re reading 365 Bible Stories and Prayers.
As my son grow older his patience grows thin. He doesn’t want to sit for story time without eating chips or holding another book in his hand flipping pages while I read to him. Tonight I didn’t have any of his other books with me so he’s crunching on his chips and trying to grab the pages while I’m reading. He be ripping the pages out his books 😩 that’s why i specifically made his book a board book so pages couldn’t be ripped out. I love this little boy so much and this was a the perfect read for tonight💙

@mamanaireclub
